import React from 'react';

function ListItems({item, index}) {
  const {snippet} = item;
  console.log(snippet);
  return (
    <>
      <li key={index}>
        <div className='thum'>
          <img src={snippet.thumbnails.standard} alt=''/>
        </div>
        <div className='textBox'>
          <img src="" alt='channelLogo'/>
          <div>
            <p className='title'></p>
            <span></span>
          </div>
        </div>
      </li>
    </>
  );
}

export default ListItems;
